import React, { useState } from 'react';
import './index.css';



const App = ()=>{

    const [FullName,setFullName] = useState({
        firstName : '',
        lastName : '',
        email : ''
    });

    const FormSubmit = (event)=>{
        event.preventDefault();
    }


    return (

        <>
            <form onSubmit={FormSubmit}>
                <div>
                    <h1>Full Name is : </h1><br/>
                    <input type='text' placeholder='Enter Your First Name' onChange={InputEvent}/><br/>
                    <input type='text' placeholder='Enter Your Last Name' onChange={InputEvent}/><br/>
                    <input type='text' placeholder='Enter Your Email' onChange={InputEvent} /><br/>
                    <button>Submit</button>
                </div>
            </form>
        </>

    );
}

export default App;
